import React from "react";

function NavBar() {

    function handleNavigation(e) {
        console.log(e)
    }
 
    return (
        <nav>
            <label >Stevens Lost & Found Tool</label>
            <ul>
              <li><button class="navb" onClick={handleNavigation()}>Home</button></li>
              <li><a class="navb" href="#">Report Lost Item</a></li>
              <li><a class="navb" href="#">Find an Item</a></li>
              <li><a class="navb" href="#">About</a></li>
            </ul>
        </nav>
    )
}

export default NavBar
